import React from 'react';

const RandomJoke = ({randomJoke}) => {
	if (randomJoke === undefined) {
		throw new Error();
	}

	return (
		<div>
			<img src={randomJoke.iconUrl} alt=""/>
			<div>
				<p>{randomJoke.value}</p>
			</div>
		</div>
	);
}

export default RandomJoke;
